import * as React from "react";
import logo from "../../logo.svg";
import Navbars from "../Navbar/navbarLogin";
// import { FaUserAlt, FaAddressCard } from "react-icons/fa";
import { BsArrowRightShort, BsArrowLeftShort } from "react-icons/bs";
import { FiEyeOff, FiEye, FiImage } from "react-icons/fi";
import { AiFillCheckCircle } from "react-icons/ai";
import { MdCameraAlt, MdArrowDropDown } from "react-icons/md";
// import { Link } from "react-router-dom";
import { data, data5 } from "../Data/data";
import emailjs from "@emailjs/browser";

import Login1 from "../../Images/Sign_up.png";

import {
  REGI01_box1EN,
  REGI01_box1DE,
  REGI01_box1TH,
  REGI01_box2EN,
  REGI01_box2DE,
  REGI01_box2TH,
  REGI01_box3EN,
  REGI01_box3DE,
  REGI01_box3TH,
  REGI01_box4EN,
  REGI01_box4DE,
  REGI01_box4TH,
  REGI01_box5EN,
  REGI01_box5DE,
  REGI01_box5TH,
  // RegisterTranslator
  REGI02_Box1v02EN,
  REGI02_Box1v02DE,
  REGI02_Box1v02TH,
  REGI02_Box2v02EN,
  REGI02_Box2v02DE,
  REGI02_Box2v02TH,
  REGI02_Box4v01EN,
  REGI02_Box4v01DE,
  REGI02_Box4v01TH,
  REGI02_Box3v02EN,
  REGI02_Box3v02DE,
  REGI02_Box3v02TH,
  REGI02_Box5v02EN,
  REGI02_Box5v02DE,
  REGI02_Box5v02TH,
  REGI02_box5EN,
  REGI02_box5DE,
  REGI02_box5TH,
  // Freelance
  REGI02_Box1v01EN,
  REGI02_Box1v01DE,
  REGI02_Box1v01TH,
  REGI02_Box2v01EN,
  REGI02_Box2v01DE,
  REGI02_Box2v01TH,
  REGI02_Box3v01EN,
  REGI02_Box3v01DE,
  REGI02_Box3v01TH,
} from "../Data/DataLanguage";

import {
  IconButton,
  Radio,
  RadioGroup,
  FormControlLabel,
  FormControl,
  Input,
  Modal,
  Typography,
  Box,
  Checkbox,
  Autocomplete,
  TextField,
} from "@mui/material";

import { useNavigate, useLocation } from "react-router-dom";

const Signup = () => {
  const { innerWidth: width } = window;
  const navigate = useNavigate();
  const location = useLocation();

  let Doc = location?.state?.languages;
  console.log(Doc);

  const [file2, setFile2] = React.useState("");
  const [file3, setFile3] = React.useState("");
  const [firstname, setFirstname] = React.useState("");
  const [district, setDistrict] = React.useState("");
  const [address, setAddress] = React.useState("");
  const [province, setProvince] = React.useState("");
  const [country, setCountry] = React.useState("");
  const [email, setEmail] = React.useState("");
  const [password, setPassword] = React.useState("");
  const [confirmpassword, setConfirmpassword] = React.useState("");
  const [mobilephone, setMobilephone] = React.useState("");
  const [screen, setScreen] = React.useState("");
  const [postalcode, setPostalCode] = React.useState("");
  const [companyname, setCompanyname] = React.useState("");
  const [juristicPersonNumber, setJuristicPersonNumber] = React.useState("");
  const [website, setWebsite] = React.useState("");
  const [bankname, setBankname] = React.useState("");
  const [branchname, setBranchname] = React.useState("");
  const [accountname, setAccountname] = React.useState("");
  const [accountnumber, setAccountnumber] = React.useState("");

  const [type, setType] = React.useState("password");
  const [type2, setType2] = React.useState("password");
  const [values, setValues] = React.useState(false);
  const [values2, setValues2] = React.useState(false);
  const [open, setOpen] = React.useState(false);
  const [open2, setOpen2] = React.useState(false);

  const [open3, setOpen3] = React.useState(false);
  const [open4, setOpen4] = React.useState(false);
  const [checked, setChecked] = React.useState(false);
  const [checked2, setChecked2] = React.useState(false);

  const [images, setImages] = React.useState([]);
  const [imageURLs, setImageURLs] = React.useState([]);
  const [languages, setLanguages] = React.useState("");
  // const [answerLanguages, setAnswerLanguages] = React.useState("");
  // const Form = React.useRef();

  React.useEffect(() => {
    if (images.length < 1) return;
    const newImageUrls = [];
    images.forEach((image) => newImageUrls.push(URL.createObjectURL(image)));
    setImageURLs(newImageUrls);
  }, [images]);

  function onImageChange(e) {
    setImages([...e.target.files]);
  }

  const handleOpen = () => setOpen(true);

  const handleClose = () => {
    setOpen(false);
    setChecked(false);
    setOpen2(true);
  };

  const send_Mail = (e) => {
    e.preventDefault();
    var templateParams = {
      user_email: `${email}`,
    };
    emailjs
      .send(
        "service_u5757dr",
        "template_dueh1d9",
        templateParams,
        "Npnv-PIsN0-rxduac"
      )
      .then(
        (result) => {
          console.log(result.text);
        },
        (error) => {
          console.log(error.text);
        }
      );
    // e.target.reset();
    handleClose();
    navigate("/Login");
  };

  const handleClose2 = () => setOpen2(false);
  const handleClose3 = () => setOpen3(false);

  const handleClose4 = () => {
    setOpen3(false);
    setChecked2(false);
    setOpen4(true);
  };

  const handleClose5 = () => {
    setOpen4(false);
    navigate("/Login");
  };

  const handleClickShowPassword = (i) => {
    if (i === 1) {
      if (type === "password") {
        setValues(!values);
        setType("text");
      } else if (type === "text") {
        setValues(!values);
        setType("password");
      }
    } else if (i === 2) {
      if (type2 === "password") {
        setValues2(!values2);
        setType2("text");
      } else if (type === "text") {
        setValues2(!values2);
        setType2("password");
      }
    }
  };

  const handleChange = (event) => {
    // console.log(event.target.value);
    setScreen(event.target.value);
  };

  const handleChange2 = (event) => {
    setChecked(event.target.checked);
    setChecked2(event.target.checked);
  };

  const goHome = (x) => {
    navigate("/", { state: { languages: `${x}` } });
  };

  const goLogin = (x) => {
    navigate("/Login", { state: { languages: `${x}` } });
  };

  return (
    <>
      <header
        className="App-header"
        style={{ color: "transparent", position: "absolute" }}
      >
        {Doc === undefined ? (
          <Navbars navigate={navigate} languages="English" />
        ) : Doc === "Thai" ? (
          <Navbars navigate={navigate} languages="Thai" />
        ) : Doc === "German" ? (
          <Navbars navigate={navigate} languages="German" />
        ) : (
          <Navbars navigate={navigate} languages="English" />
        )}
      </header>

      <div>
        <div
          style={{
            position: "absolute",
            width: "50%",
            height: " -webkit-fill-available",
            background: "#66C0FE",
          }}
        >
          <img
            src={Login1}
            alt="resgister"
            style={{
              width: 460,
              position: "absolute",
              top: " 10%",
              left: 100,
            }}
          />
        </div>

        <div
          style={{
            position: "absolute",
            width: "50%",
            height: "-webkit-fill-available",
            left: "50%",
            background: "#FFF3CC",
          }}
        >
          {screen === "" ? (
            <>
              {Doc === "English" ? (
                <div>
                  <div
                    style={{
                      position: "fixed",
                      top: 20,
                      left: width * 0.59,
                      textAlign: "-webkit-center",
                      width: 500,
                      background: " #FFFFFF",
                      boxShadow: " 0px 4px 25px rgba(0, 0, 0, 0.15)",
                      borderRadius: 20,
                      padding: 30,
                    }}
                  >
                    <button
                      style={{
                        fontWeight: 400,
                        fontSize: 18,
                        textDecorationLine: "none",
                        textAlign: "left",
                        marginBottom: 20,
                        float: "left",
                        background: "transparent",
                        border: "none",
                      }}
                      onClick={() => goHome(Doc)}
                    >
                      <p id={"Hometext"}>{REGI01_box1EN[0].label}</p>
                      <BsArrowLeftShort id={"Hometext2"} />
                    </button>

                    <button
                      style={{
                        fontWeight: 400,
                        textAlign: "right",
                        marginBottom: 20,
                        float: "right",
                        color: "#D9D9D9",
                        background: "transparent",
                        border: "none",
                      }}
                      onClick={() => goLogin(Doc)}
                    >
                      <p id={"Signuptext"}>{REGI01_box1EN[1].label}</p>
                      <BsArrowRightShort id={"Signuptext2"} />
                    </button>

                    <h2 className="textSignup">{REGI01_box1EN[2].label}</h2>
                    <div>
                      <FormControl style={{ display: "inherit" }}>
                        <RadioGroup
                          row
                          aria-labelledby="demo-row-radio-buttons-group-label"
                          name="row-radio-buttons-group"
                        >
                          <FormControlLabel
                            checked={true}
                            onChange={handleChange}
                            name="radio-buttons"
                            value=""
                            control={<Radio />}
                            label={REGI01_box1EN[3].label}
                            style={{ marginRight: 50 }}
                          />
                          <FormControlLabel
                            onChange={handleChange}
                            name="radio-buttons"
                            value="For Translators"
                            control={<Radio />}
                            label={REGI01_box1EN[4].label}
                          />
                        </RadioGroup>
                      </FormControl>
                    </div>

                    <div style={{ textAlign: "left", marginTop: 10 }}>
                      <p
                        style={{
                          fontWeight: 500,
                          fontSize: 15,
                          color: "#242424",
                        }}
                      >
                        {REGI01_box1EN[5].label}
                      </p>
                      <input
                        type="text"
                        value={firstname}
                        onChange={(e) => setFirstname(e.target.value)}
                        placeholder={REGI01_box1EN[5].label}
                        style={{
                          background: "#FFFFFF",
                          border: "1px solid #F1F1F1 ",
                          borderRadius: 20,
                          width: "100%",
                          height: 30,
                          padding: 20,
                          paddingLeft: 12,
                          margin: 10,
                          fontSize: 13,
                        }}
                      />
                    </div>

                    <div style={{ textAlign: "left" }}>
                      <p
                        style={{
                          fontWeight: 500,
                          fontSize: 15,
                          color: "#242424",
                        }}
                      >
                        {REGI01_box1EN[6].label}
                      </p>
                      <input
                        type="text"
                        name="user_email"
                        // value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        placeholder={REGI01_box1EN[7].label}
                        style={{
                          background: "#FFFFFF",
                          border: "1px solid #F1F1F1",
                          borderRadius: 20,
                          width: "100%",
                          height: 30,
                          padding: 20,
                          paddingLeft: 12,
                          margin: 10,
                          fontSize: 13,
                        }}
                      />
                    </div>

                    <div style={{ textAlign: "left" }}>
                      <p
                        style={{
                          fontWeight: 500,
                          fontSize: 15,
                          color: "#242424",
                        }}
                      >
                        {REGI01_box1EN[8].label}
                      </p>

                      <input
                        type={type}
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        placeholder={REGI01_box1EN[9].label}
                        style={{
                          background: "#FFFFFF",
                          border: "1px solid #F1F1F1 ",
                          borderRadius: 20,
                          borderColor: "#F1F1F1",
                          width: "100%",
                          height: 30,
                          padding: 20,
                          paddingLeft: 12,
                          margin: 10,
                          fontSize: 13,
                        }}
                      />
                      <IconButton
                        onClick={() => handleClickShowPassword(1)}
                        edge="end"
                        style={{ position: "absolute", right: 40, top: 380 }}
                      >
                        {values ? <FiEye /> : <FiEyeOff />}
                      </IconButton>
                    </div>

                    <div style={{ textAlign: "left" }}>
                      <p
                        style={{
                          fontWeight: 500,
                          fontSize: 15,
                          color: "#242424",
                        }}
                      >
                        {REGI01_box1EN[10].label}
                      </p>

                      <input
                        type={type2}
                        value={confirmpassword}
                        onChange={(e) => setConfirmpassword(e.target.value)}
                        placeholder={REGI01_box1EN[9].label}
                        style={{
                          background: "#FFFFFF",
                          border: "1px solid #F1F1F1 ",
                          borderRadius: 20,
                          borderColor: "#F1F1F1",
                          width: "100%",
                          height: 30,
                          padding: 20,
                          paddingLeft: 12,
                          margin: 10,
                          fontSize: 13,
                        }}
                      />
                      <IconButton
                        onClick={() => handleClickShowPassword(2)}
                        edge="end"
                        style={{ position: "absolute", right: 40, top: 465 }}
                      >
                        {values2 ? <FiEye /> : <FiEyeOff />}
                      </IconButton>
                    </div>

                    <div style={{ textAlign: "left", marginBottom: 10 }}>
                      <p
                        style={{
                          fontWeight: 500,
                          fontSize: 15,
                          color: "#242424",
                        }}
                      >
                        {REGI01_box1EN[11].label}
                      </p>

                      <input
                        type="text"
                        value={mobilephone}
                        onChange={(e) => setMobilephone(e.target.value)}
                        placeholder={REGI01_box1EN[11].label}
                        style={{
                          background: "#FFFFFF",
                          border: "1px solid #F1F1F1 ",
                          borderRadius: 20,
                          borderColor: "#F1F1F1",
                          width: "100%",
                          height: 30,
                          padding: 20,
                          paddingLeft: 12,
                          margin: 10,
                          fontSize: 13,
                        }}
                      />
                    </div>

                    <button
                      style={{
                        width: "100%",
                        borderRadius: 20,
                        background: " #001E33",
                        height: 40,
                        color: "#FFFFFF",
                        fontSize: 18,
                        borderColor: "transparent",
                      }}
                      onClick={() => setScreen("3")}
                    >
                      {REGI01_box1EN[12].label}
                    </button>
                  </div>
                </div>
              ) : Doc === "Thai" ? (
                <div>
                  <div
                    style={{
                      position: "fixed",
                      top: 20,
                      left: width * 0.59,
                      textAlign: "-webkit-center",
                      width: 500,
                      background: " #FFFFFF",
                      boxShadow: " 0px 4px 25px rgba(0, 0, 0, 0.15)",
                      borderRadius: 20,
                      padding: 30,
                    }}
                  >
                    <div
                      style={{
                        fontWeight: 400,
                        fontSize: 18,
                        textDecorationLine: "none",
                        textAlign: "left",
                        marginBottom: 20,
                        float: "left",
                        background: "transparent",
                        border: "none",
                      }}
                      onClick={() => goHome(Doc)}
                    >
                      <p id={"Hometext"}>{REGI01_box1TH[0].label}</p>
                      <BsArrowLeftShort id={"Hometext2"} />
                    </div>

                    <button
                      style={{
                        fontWeight: 400,
                        textAlign: "right",
                        marginBottom: 20,
                        float: "right",
                        color: "#D9D9D9",
                        background: "transparent",
                        border: "none",
                      }}
                      onClick={() => goLogin(Doc)}
                    >
                      <p id={"Signuptext"}>{REGI01_box1TH[1].label}</p>
                      <BsArrowRightShort id={"Signuptext2"} />
                    </button>

                    <h2 className="textSignup">{REGI01_box1TH[2].label}</h2>
                    <div>
                      <FormControl style={{ display: "inherit" }}>
                        <RadioGroup
                          row
                          aria-labelledby="demo-row-radio-buttons-group-label"
                          name="row-radio-buttons-group"
                        >
                          <FormControlLabel
                            checked={true}
                            onChange={handleChange}
                            name="radio-buttons"
                            value=""
                            control={<Radio />}
                            label={REGI01_box1TH[3].label}
                            style={{ marginRight: 50 }}
                          />
                          <FormControlLabel
                            onChange={handleChange}
                            name="radio-buttons"
                            value="For Translators"
                            control={<Radio />}
                            label={REGI01_box1TH[4].label}
                          />
                        </RadioGroup>
                      </FormControl>
                    </div>

                    <div style={{ textAlign: "left", marginTop: 10 }}>
                      <p
                        style={{
                          fontWeight: 500,
                          fontSize: 15,
                          color: "#242424",
                        }}
                      >
                        {REGI01_box1TH[5].label}
                      </p>
                      <input
                        type="text"
                        value={firstname}
                        onChange={(e) => setFirstname(e.target.value)}
                        placeholder={REGI01_box1TH[5].label}
                        style={{
                          background: "#FFFFFF",
                          border: "1px solid #F1F1F1 ",
                          borderRadius: 20,
                          width: "100%",
                          height: 30,
                          padding: 20,
                          paddingLeft: 12,
                          margin: 10,
                          fontSize: 13,
                        }}
                      />
                    </div>

                    <div style={{ textAlign: "left" }}>
                      <p
                        style={{
                          fontWeight: 500,
                          fontSize: 15,
                          color: "#242424",
                        }}
                      >
                        {REGI01_box1TH[6].label}
                      </p>
                      <input
                        type="text"
                        name="user_email"
                        // value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        placeholder={REGI01_box1TH[7].label}
                        style={{
                          background: "#FFFFFF",
